SET time_zone='+00:00';

CREATE TABLE config_heaters (
  name char(12) NOT NULL DEFAULT '' COMMENT 'Heater name',
  bottom_depth float(7,2) DEFAULT NULL COMMENT 'Depth below ground surface at bottom of heater (ft)',
  length float(4,2) DEFAULT NULL COMMENT 'Heater length (ft)',
  power_supply_unit char(6) NOT NULL DEFAULT '' COMMENT 'Name of power supply unit that this heater is connected to',
  channel tinyint(2) unsigned DEFAULT NULL COMMENT  'Channel number',
  PRIMARY KEY (name)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 CHECKSUM=1;

INSERT INTO config_heaters VALUES ('I-1',12,10,'INV01',1), ('I-2',16,12,'INV01',2), ('I-3',14,16,'INV01',3);

CREATE TABLE data_heaters (
  time timestamp NOT NULL DEFAULT current_timestamp(),
  name varchar(12) NOT NULL COMMENT 'Heater name',
  amps float(5,2) NOT NULL COMMENT 'Heater current (A)',
  total_energy float(7,3) DEFAULT 0.000 COMMENT 'Cumulative total energy (kWh)',
  PRIMARY KEY (time,name)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

